Black Lives Matter. 
We must show up. We must respond in new ways - speaking up, listen, donate, protest, control racial injustices, educate ourselves and our kids, support black owned businesses and most of all commit to do the work that amplifies change not just this week, but always. .
Join me, support and donate to the following organizations:
.
@thelovelandfoundation which brings opportunities and healing to communities of color and especially to black women and girls. .
@communitymovementbuilders focusing on creating self - determining communities by organizing and cooperative economics. .
@colorofchange focuses on designing campaigns powerful enough to end practices that unfairly hold black people back and champion solutions that move us all forward. .
